svg.script:


    var s = Snap("#Truck_close");
    var sbody = Snap("#truck");
    var scloud1 = Snap("#sSmileCloud");
    var scloud2 = Snap("#sSmileCloud2");
    var sbubble3 = Snap("#SBubble3")
    var sbubble2 = Snap("#SBubble2")
    var sbubble1 = Snap("#SBubble1")
    var tires       = Snap("#Tires_1_")
    var truckfar    = Snap("#TruckFar")
    var bush        = Snap("#bush_1_")
    var s2 = Snap("#mountains");


    sbubble3.attr({ opacity:'1' })
    sbubble2.attr({ opacity:'1' })
    sbubble1.attr({ opacity:'1' })

        var firstStepTruckBody = function(){

            sbody.animate({ transform:'t0,0' },200, secondStepTruckBody)

        }
        var secondStepTruckBody = function(){

            sbody.animate({ transform:'t0,-5' },200, firstStepTruckBody)

        }
    	var firstStepTires = function(){

            tires.animate({ transform:'t0,-5' },200, secondStepTires)

        }
        var secondStepTires = function(){

            tires.animate({ transform:'t0,0' },200, firstStepTires)

        }

        var firstStepBody = function(){

            s.animate(
                { transform:'t800,-5' },0, secondStepBody
            )

        }
        var secondStepBody = function(){

            s.animate(
                { transform:'t-400,0' },4000, firstStepBody
            )

        }
		var firstStepBody2 = function(){

            truckfar.animate(
                { transform:'t400,0' },4000, secondStepBody2
            )

        }
        var secondStepBody2 = function(){

            truckfar.animate(
                { transform:'t0,0' },0, firstStepBody2
            )

        }
        var firstStepBush = function(){

            bush.animate({ transform: 't400,0'},5000, secondStepBush)

        }

        var secondStepBush = function(){

            bush.attr({ transform:'translate(-400, 0)'})

            firstStepBush()         

        }
        var bubbleFadeOut1 = function(){

            sbubble1.animate( { opacity: '0' }, 500 ,bubbleFadeIn1)


        }
        var bubbleFadeIn1 = function(){

            sbubble1.animate( { opacity: '1' }, 500 , bubbleFadeOut1)

        }
        var bubbleFadeOut2 = function(){

            sbubble2.animate( { opacity: '0' }, 1000 ,bubbleFadeIn2)

        }
        var bubbleFadeIn2 = function(){

            sbubble2.animate( { opacity: '1' }, 1000 , bubbleFadeOut2)

        }
        var bubbleFadeOut3 = function(){

            sbubble3.animate( { opacity: '0' }, 2000 ,bubbleFadeIn3)

        }
        var bubbleFadeIn3 = function(){

            sbubble3.animate( { opacity: '1' }, 2000 , bubbleFadeOut3)

        }

        bubbleFadeOut2()
        bubbleFadeOut3()
        bubbleFadeOut1()
        firstStepTruckBody()
        firstStepBody()
        firstStepTires()
        firstStepBush()
        firstStepBody2()

        var mountainMovement = function(){

            s2.animate({ transform: 't240,0'},12000, mountainMovementMove)

        }
            var mountainMovementMove = function(){


s2.attr({ transform:'translate(-200, 0)'})
                  mountainMovement()
            }

                setInterval(function(){
scloud1.animate({ transform:'t0,-20'},300,function(){
scloud1.animate({ transform:'t0,0'},300)
})
        },600)
                        setInterval(function(){
scloud2.animate({ transform:'t0,-20'},300,function(){
